import React from "react";
import axios from "axios";

export default function Parent() {

    const [notes, getNotes] = useState('');

    const url = 'http://omdbapi.com/?apikey=b864d43e&s=titanic';

    const getAllNotes = () => {
        axios.get(`${url}past`)
        .then((response)=> {
            const getAllNotes = response.data.notes.allNotes;

        })
        .catch(error => console.error(`Error: ${error}`));
    }
}
